[Form]
public class WHSParameters extends FormRun
{
    boolean                     runExecuteDirect;
    TmpIdRef                    tmpIdRef;

    NumberSeqScope              scope;
    NumberSeqApplicationModule  numberSeqApplicationModule;
    container                   numberSequenceModules;

    WHSParametersForm           whsParametersForm;
    boolean                     parametersWarehouseInventoryTransactionDisableWarningFlight = WHSParametersWarehouseInventoryTransactionDisableWarningFlight::instance().isEnabled();

}

public void init()
{
    whsParametersForm = new WHSParametersForm();

    this.numberSeqPreInit();

    WHSParameters tmpParameters = WHSParameters::find();

    super();

    this.numberSeqPostInit();

    WHSInitializeReleaseToWarehouseRule.visible(whsParametersForm.isWHSInitializeReleaseToWarehouseRuleVisible());
    InventoryUpdateLogCleanupTabPage.visible(WHSInventoryUpdateLogToggle::instance().isEnabled());
    EnableScheduleWorkCreation.visible(!tmpParameters.EnableScheduleWorkCreation);

    WHSParameters_ds.object(fieldNum(WHSParameters, EnablePurchaseOrderRegistrationInExternalReview)).visible(true);

    WHSParameters_LicensePlateIdMinLength.enabled(WHSParameters.LicensePlateCreationRule == WHSLicensePlateCreationRule::MinimumLength);

    if (WHSParametersWarehouseInventoryTransactionWarningFlight::instance().isEnabled() && 
        WHSInventoryScenarioInventoryTransactionMechanism::anyScenarioUsesInventoryTransactions())
    {
        warning("@WAX:WHSParametersWarehouseInventoryTransactionWarning");
    }

}

void numberSeqPostInit()
{
    numberSequenceReference_ds.object(fieldNum(NumberSequenceReference, AllowSameAs)).visible(numberSeqApplicationModule.sameAsActive());
    referenceSameAsLabel.visible(numberSeqApplicationModule.sameAsActive());
}

void numberSeqPreInit()
{
    runExecuteDirect   = false;

    numberSequenceModules = [NumberSeqModule::WHS];
    numberSeqApplicationModule = new WHSNumberSeqModuleWHS();
    scope = NumberSeqScopeFactory::createDataAreaScope();
    NumberSeqApplicationModule::createReferencesMulti(numberSequenceModules, scope);
    tmpIdRef.setTmpData(NumberSequenceReference::configurationKeyTableMulti(numberSequenceModules));
}

public void run()
{
    super();

    // The legacy packing parameter should only be active if already in use
    if (WHSParameters.PackingLocType == '')
    {
        WHSParameters_PackingLocType.enabled(false);
    }

    this.setEnableWaveStepCodeVisibility();
    this.setCleanupArchivedWarehouseReservationTransactionsAfterDaysEnabledDisabled();
}

[SysObsolete('Method is obsoleted as WHSOrgWideWaveStepCodeFeature feature is enabled by default.', false, 22\5\2023)]
public void setEnableWaveStepCodeVisibility()
{
}

private void setCleanupArchivedWarehouseReservationTransactionsAfterDaysEnabledDisabled()
{
    WHSParameters_CleanupArchivedWarehouseReservationTransactionsAfterDays.enabled(WHSParameters_CleanupArchivedWarehouseReservationTransactions.checked());
}

public int active()
{
    int ret = super();

    if (WHSParameters.CleanupInventoryUpdateLogAfterDays < WHSParametersConstants::MinimumCleanupInventoryUpdateLogAfterDays)
    {
        WHSParameters.CleanupInventoryUpdateLogAfterDays = WHSParametersConstants::DefaultCleanupInventoryUpdateLogAfterDays;
    }

    WHSParameters_LicensePlateIdMinLength.enabled(WHSParameters.LicensePlateCreationRule == WHSLicensePlateCreationRule::MinimumLength);

    return ret;
}

void removeFilter()
{
    runExecuteDirect = false;
    numbersequenceReference_ds.executeQuery();
}

void executeQuery()
{
    if (runExecuteDirect)
    {
        super();
    }
    else
    {
        runExecuteDirect = true;
        this.queryRun(NumberSeqReference::buildQueryRunMulti(numberSequenceReference,
                                                             tmpIdRef,
                                                             numberSequenceTable,
                                                             numberSequenceModules,
                                                             scope));

        QueryBuildDataSource qbDS = this.queryRun().query().dataSourceTable(tableNum(NumberSequenceReference)).addDataSource(tableNum(WHSNumberSequenceExtReference));
        qbDS.joinMode(JoinMode::OuterJoin);
        qbDS.fetchMode(QueryFetchMode::One2One);
        qbDS.relations(true);

        numbersequenceReference_ds.research();
    }
}

int  active()
{
    int ret;

    ret = super();

    buttonNumberSequenceGroup.enabled(numberSequenceReference.groupEnabled());

    whsNumberSequenceExtReference_ds.allowEdit(WHSNumberSeqExt::isDataTypeSupported(NumberSequenceDatatype::find(numberSequenceReference.NumberSequenceDatatype).DatatypeId));

    return ret;
}

public display TaxBookSectionId taxBookSectionId()
{
    NumberSequenceTable numberSequenceTableLocal;

    if (numberSequenceReference.NumberSequenceId)
    {
        select firstonly NumberSequence from numberSequenceTableLocal where numberSequenceTableLocal.RecId == numberSequenceReference.NumberSequenceId;
    }

    return TaxBookSection::findVoucherSeries(numberSequenceTableLocal.RecId).TaxBookSectionId;
}

public Common resolveReference(FormReferenceControl _formReferenceControl)
{
    return whsParametersForm.resolveReference(_formReferenceControl, scope);
}

public Common lookupReference(FormReferenceControl _formReferenceControl)
{
    NumberSequenceTable     selectedRecord;
    SysReferenceTableLookup sysTableLookup = SysReferenceTableLookup::newParameters(tableNum(NumberSequenceTable), _formReferenceControl, true);
    Query lookupQuery;

    // Display the Title and Department fields in the lookup form.
    sysTableLookup.addLookupfield(fieldNum(NumberSequenceTable, NumberSequence));

    // Create a custom Query that filters on NumberSequenceScope.
    lookupQuery = new Query();
    lookupQuery.addDataSource(tableNum(NumberSequenceTable)).addRange(fieldNum(NumberSequenceTable, NumberSequenceScope)).value(queryValue(scope.getId(true)));
    sysTableLookup.parmQuery(lookupQuery);

    // Return the record selected by the user.
    selectedRecord = sysTableLookup.performFormLookup();

    return selectedRecord;
}

public void write()
{
    if (whsNumberSequenceExtReference.NumberSequenceExtId)
    {
        if (!whsNumberSequenceExtReference.NumberSequenceReference)
        {
            whsNumberSequenceExtReference.NumberSequenceReference = numberSequenceReference.RecId;
        }

        super();
    }
    else
    {
        if (whsNumberSequenceExtReference.RecId)
        {
            whsNumberSequenceExtReference.delete();
            whsNumberSequenceExtReference_ds.reread();
            whsNumberSequenceExtReference_ds.refresh();
        }
    }
}

public boolean validateWrite()
{
    boolean ret = super();

    if (ret)
    {
        ret = whsNumberSequenceExtReference.validateReference(numberSequenceReference);
    }

    return ret;
}

public boolean validate()
{
    boolean ret;

    ret = super();

    if (ret)
    {
        ret = whsNumberSequenceExtReference.validateReference(numberSequenceReference);
    }

    return ret;
}

[Hookable(false)]
internal edit boolean setUseWarehouseInventoryTransactionMechanism(
    boolean _set,
    WHSInventoryScenarioInventoryTransactionMechanism _record,
    boolean _useWarehouseInventoryTransactionMechanism)
{
    if (_set)
    {
        _record.InventoryTransactionMechanism =
            _useWarehouseInventoryTransactionMechanism ? WHSInventoryTransactionMechanismEnum::WHSInventoryTransaction : WHSInventoryTransactionMechanismEnum::InventTrans;

        if (parametersWarehouseInventoryTransactionDisableWarningFlight && !_useWarehouseInventoryTransactionMechanism)
        {
            warning("@WAX:WHSParametersWarehouseInventoryTransactionDisableWarning");
        }

    }

    return _record.InventoryTransactionMechanism == WHSInventoryTransactionMechanismEnum::WHSInventoryTransaction;
}

